from pathlib import Path
path = Path(__file__).resolve().parent

ids = [p.name for p in path.iterdir() if p.is_dir()]
ids.sort()

registers = []

for id in ids:
    register_path = path / id / "register.mcfunction"
    register = Path(register_path).read_text("utf-8").splitlines()
    pos = register[12][50:]
    target = next((r for r in registers if r["pos"] == pos), None)
    if target is not None:
        print(f"dupe: {target["id"]} → {id} at {pos}")
        target["id"] = id
    else:
        registers.append({
            "id": id,
            "pos": pos
        })

print(sorted([int(r["id"]) for r in registers]))

